import { Box } from "@mui/material"
import { SnackbarProvider } from 'notistack'


const Overview = () => {
    return (
      <Box
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100vw',
        height: '100vh',
        backgroundColor: 'blue',
      }}
    />)
}

export default function IntegrationNotistack() {
    return (
      <SnackbarProvider maxSnack={3}>
        <Overview />
      </SnackbarProvider>
    );
  }
